import React, { Component } from "react";
import "./Works.css";
import Header from "../components/Header";
import styled from "styled-components";

import thumb_coc from "../img/thumb_coc.jpg";
import thumb_yng from "../img/thumb_esrc_pink.jpg";
import thumb_gutsy from "../img/thumb_Gutsy.jpg";
import thumb_doh from "../img/thumb_ProjectionMapping.jpg";
import thumb_jini from "../img/thumb_MovWork.jpg";
import thumb_toyp from "../img/thumb_ProjectionMapping2.jpg";

const MainContainer = styled.div`
  height: auto;
  padding-top: 10em;
  padding-left: 17%;
  padding-right: 17%;
  background-color: white;
`;

const ItemCell = styled.div`

`;

class Works extends Component {
  render() {
    return (
      <div>
        <Header />
        <MainContainer>
          <div className="item-container">
            <div className="category uiux">
              <div className="category-title-bg">
                <div className="category-title">UI/UX</div>
              </div>

              <a href="./contents/coc2016.html" className="item-cell">
                <div>
                  <img alt={"COC2016"} className="item-thumb" src={thumb_coc} />
                </div>
                <strong>공간 VR</strong> <br></br>
                <em>COC 2016</em>
              </a>

              <a href="./contents/yng.html" className="item-cell">
                <div>
                  <img
                    alt={"연애능력고사"}
                    className="item-thumb"
                    src={thumb_yng}
                  />
                </div>
                <strong>UI 제작</strong> <br></br>
                <em>연애능력고사</em>
              </a>

              <a href="#" className="item-cell">
                <div>
                  <img alt={"Gutsy"} className="item-thumb" src={thumb_gutsy} />
                </div>
                <strong>UI 제작 / UX 설계</strong> <br></br>
                <em>Gutsy</em>
              </a>
            </div>

            <div className="category graphics">
              <div className="category-title-bg">
                <div className="category-title">Graphics</div>
              </div>
              <a href="#" className="item-cell">
                <div>
                  <img
                    alt={"Dancing on the hills"}
                    className="item-thumb"
                    src={thumb_doh}
                  />
                </div>
                <strong>프로젝션 매핑</strong> <br></br>
                <em>Dancing on the hills</em>
              </a>

              <a href="#" className="item-cell">
                <div>
                  <img
                    alt={"Empi Jini"}
                    className="item-thumb"
                    src={thumb_jini}
                  />
                </div>
                <strong>모션그래픽</strong> <br></br>
                <em>Empy jini</em>
              </a>
            </div>

            <div className="category web">
              <div className="category-title-bg">
                <div className="category-title">Web</div>
              </div>
              <a href="#" className="item-cell">
                <div>
                  <img
                    alt={"Toy Projects"}
                    className="item-thumb"
                    src={thumb_toyp}
                  />
                </div>
                <strong>?</strong> <br></br>
                <em>toy project</em>
              </a>
            </div>
          </div>
        </MainContainer>
      </div>
    );
  }
}

export default Works;
